import React from 'react'
import CIcon from '@coreui/icons-react'
import { freeSet } from '@coreui/icons'
import {getCookie} from '../helpers/sessionCookie.js'
import { CBadge } from '@coreui/react'


let _navWind =  [

  {
    _tag: 'CSidebarNavDropdown',
    name: 'Monitor',
    icon: <CIcon content={freeSet.cilMonitor} customClasses="c-sidebar-nav-icon"/>,
    _children: [
      {
        _tag: 'CSidebarNavDropdown',
        name: 'Status',
        to: '/dashboard',
        // icon: <CIcon content={freeSet.cilMonitor} customClasses="c-sidebar-nav-icon"/>
        _children: [
          {
            _tag: 'CSidebarNavItem',
            name: 'Now',
            to: '/dashboard',
          },
          {
            _tag: 'CSidebarNavItem',
            name: '10-min Averages',
            to: '/modules/status/ten-min-average',
          },
        ]
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Overview',
        to: '/modules/overview',
        // icon: <CIcon content={freeSet.cilChartPie} customClasses="c-sidebar-nav-icon"/>
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Alerts',
        to: '/modules/overview/alerts',
        // icon: <CIcon content={freeSet.cilChartPie} customClasses="c-sidebar-nav-icon"/>
      },
      {
        _tag: 'CSidebarNavDropdown',
        name: 'Climate',
        route: '/modules/climate',
        // icon: <CIcon content={freeSet.cilCloudy} customClasses="c-sidebar-nav-icon"/>
        _children: [
          {
            _tag: 'CSidebarNavItem',
            name: 'Summary',
            to: '/modules/climate/summary',
          },
          {
            _tag: 'CSidebarNavItem',
            name: 'Trends',
            to: '/modules/climate/trends',
          },
          {
            _tag: 'CSidebarNavItem',
            name: 'Forecast',
            to: '/modules/climate/forecast',
          },
        ]
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Data Availability  ',
        to: '/modules/data-availability',
        // icon: <CIcon name="cil-list-rich" customClasses="c-sidebar-nav-icon"/>
      },
    ]
  }
]

if(getCookie('user') == 10) {

  _navWind = [..._navWind, 
    {
      _tag: 'CSidebarNavDropdown',
      name: 'AI Analytics',
      icon: <CIcon content={freeSet.cilLightbulb} customClasses="c-sidebar-nav-icon"/>,
      _children: [
        {
          _tag: 'CSidebarNavItem',
          name: 'Energy Generation',
          to: '/modules/ai-analytics/energy-generation',
          // icon: <CIcon content={freeSet.cilMonitor} customClasses="c-sidebar-nav-icon"/>
        },
        {
          _tag: 'CSidebarNavItem',
          name: 'Fault Analysis',
          to: '/modules/ai-analytics/fault-analysis',
          // icon: <CIcon content={freeSet.cilChartPie} customClasses="c-sidebar-nav-icon"/>
        },
      ]
    },
  ]
}

_navWind = [..._navWind, 
  {
    _tag: 'CSidebarNavItem',
    name: 'Budget',
    to: '/modules/budget',
    icon: <CIcon content={freeSet.cilDollar} customClasses="c-sidebar-nav-icon"/>
  },


  // {
  //   _tag: 'CSidebarNavItem',
  //   name: 'Power Curve',
  //   to: '/modules/power-curve',
  //   icon: <CIcon name="cil-graph" customClasses="c-sidebar-nav-icon"/>
  // },

  {
    _tag: 'CSidebarNavDropdown',
    name: 'Analyze',
    route: '/modules/analyze',
    icon: 'cil-graph',
    _children: [
      {
        _tag: 'CSidebarNavItem',
        name: 'Performance',
        to: '/modules/performance',
        // icon: <CIcon content={freeSet.cilChartLine} customClasses="c-sidebar-nav-icon"/>
      },
      {
        _tag: 'CSidebarNavDropdown',
        name: 'Power Curve',
        route: '/modules/power-curve',
        // icon: 'cil-graph',
        _children: [
          {
            _tag: 'CSidebarNavItem',
            name: 'Summary',
            to: '/modules/power-curve/summary',
          },
          {
            _tag: 'CSidebarNavItem',
            name: 'Analysis',
            to: '/modules/power-curve/analysis',
          },
          {
            _tag: 'CSidebarNavItem',
            name: 'Benchmark',
            to: '/modules/power-curve/benchmark',
          },
          
        ]
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Alarms',
        to: '/modules/alarms',
        // icon: <CIcon name="cil-alarm" customClasses="c-sidebar-nav-icon"/>
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Availability and Losses',
        to: '/modules/availability-and-losses',
        // icon: <CIcon name="cil-list-rich" customClasses="c-sidebar-nav-icon"/>
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Diagnostics',
        to: '/modules/diagnostics',
        // icon: <CIcon content={freeSet.cilSpeedometer} customClasses="c-sidebar-nav-icon"/>
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Curtailments',
        to: '/modules/curtailments',
        // icon: <CIcon content={freeSet.cilChart} customClasses="c-sidebar-nav-icon"/>
      },
    ]
  },
  {
    _tag: 'CSidebarNavItem',
    name: 'Documents',
    to: '/modules/maintenance',
    addlinkclasses: 'premium',
    icon: <CIcon content={freeSet.cilFile} customClasses="c-sidebar-nav-icon"/>,
    // badge: <div className="hola"></div>
  },

  // {
  //   _tag: 'CSidebarNavItem',
  //   name: 'Weather Forecast',
  //   to: '/modules/weather-forecast',
  //   icon: <CIcon content={freeSet.cilSun} customClasses="c-sidebar-nav-icon"/>
  // },


]


let _navSolar =  [

  {
    _tag: 'CSidebarNavDropdown',
    name: 'Monitor',
    icon: <CIcon content={freeSet.cilMonitor} customClasses="c-sidebar-nav-icon"/>,
    _children: [
      {
        _tag: 'CSidebarNavItem',
        name: 'Current Status',
        to: '/dashboard',
        // icon: <CIcon content={freeSet.cilMonitor} customClasses="c-sidebar-nav-icon"/>
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Overview',
        to: '/modules/overview',
        // icon: <CIcon content={freeSet.cilChartPie} customClasses="c-sidebar-nav-icon"/>
      },
      {
        _tag: 'CSidebarNavDropdown',
        name: 'Climate',
        route: '/modules/climate',
        // icon: <CIcon content={freeSet.cilCloudy} customClasses="c-sidebar-nav-icon"/>
        _children: [
          {
            _tag: 'CSidebarNavItem',
            name: 'Trends',
            to: '/modules/climate/trends',
          },
          {
            _tag: 'CSidebarNavItem',
            name: 'Forecast',
            to: '/modules/climate/forecast',
          },
        ]
      },
    ]
  },
  {
    _tag: 'CSidebarNavDropdown',
    name: 'Analyze',
    route: '/modules/analyze',
    icon: 'cil-graph',
    _children: [
      {
        _tag: 'CSidebarNavItem',
        name: 'Performance',
        to: '/modules/performance',
        // icon: <CIcon content={freeSet.cilChartLine} customClasses="c-sidebar-nav-icon"/>
      },
    ]
  },
]

let _nav;
if (getCookie('parkType') == 'solar') {
  _nav = _navSolar
} else {
  _nav = _navWind
}

_nav = [..._nav,
  {
    _tag: 'CSidebarNavDropdown',
    name: 'Reports',
    route: '/modules/reports',
    icon: <CIcon content={freeSet.cilDescription} customClasses="c-sidebar-nav-icon"/>,
    _children: [
      {
        _tag: 'CSidebarNavItem',
        name: 'E-mail settings',
        to: '/modules/reports/settings',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Generate',
        to: '/modules/reports/generate',
      }
    ]
  },
]

const functionalities = JSON.parse(getCookie('functionalities'));

const filteredNav = [];
_nav.forEach(level1 => {
  
  const children = level1._children
  if(children && children.length > 0) {

  }
});

_nav.map((level1) => {
  let children = level1._children
  if (children && children.length > 0) {
    children = children.map((level2) => {
      let children2 = level2._children
      if (!children2) {
        return 
      }
    })
  }
  level1.code == gen.code
});

export default _nav
